        return (
            <div>
                <CustomerProfile id={this.props.id} image={this.props.image} name = {this.props.name} />
                <CustomerInfo birthday = {this.props.birthday} gender = {this.props.gender} job = {this.props.job} />
            </div>
        )
    }
}

